    <div class="wrapper">
        <div class="profile-card js-profile-card">
            <div class="profile-card__img">
                <img src="assets/images/profile.jpg" alt="profile card">
            </div>

            <div class="profile-card__cnt js-profile-cnt">
                <div class="profile-card__name">Fedor Paretsky</div>
                <div class="profile-card__txt">I adore optimization and forming short-cuts.</div>
                <div class="profile-card-loc">
                    <span class="profile-card-loc__icon">
                        <svg class="icon">
                            <use xlink:href="#icon-location"></use>
                        </svg>
                    </span>

                    <span class="profile-card-loc__txt">
                        Seattle, WA
                    </span>
                </div>

                <div class="profile-card-inf">
                    <div class="profile-card-inf__item">
                        <div id="years_old" class="profile-card-inf__title">20</div>
                        <div class="profile-card-inf__txt">years old</div>
                    </div>

                    <div class="profile-card-inf__item">
                        <div id="coffee_num" class="profile-card-inf__title">1103</div>
                        <div class="profile-card-inf__txt">coffees</div>
                    </div>

                    <div class="profile-card-inf__item">
                        <div class="profile-card-inf__title">5</div>
                        <div class="profile-card-inf__txt">hobbies</div>
                    </div>

                    <div class="profile-card-inf__item">
                        <div class="profile-card-inf__title">2</div>
                        <div class="profile-card-inf__txt">non-profits</div>
                    </div>
                </div>

                <div class="profile-card-social">
                    <a href="https://github.com/f3d0r" class="profile-card-social__item github" target="_blank">
                        <span class="icon-font">
                            <svg class="icon">
                                <use xlink:href="#icon-github"></use>
                            </svg>
                        </span>
                    </a>

                    <a href="https://www.linkedin.com/in/fedorparetsky/" class="profile-card-social__item facebook"
                        target="_blank">
                        <span class="icon-font">
                            <svg class="icon">
                                <use xlink:href="#icon-linkedin"></use>
                            </svg>
                        </span>
                    </a>

                    <a href="https://twitter.com/f310r" class="profile-card-social__item twitter" target="_blank">
                        <span class="icon-font">
                            <svg class="icon">
                                <use xlink:href="#icon-twitter"></use>
                            </svg>
                        </span>
                    </a>

                    <a href="https://angel.co/f3d0r" class="profile-card-social__item instagram" target="_blank">
                        <span class="icon-font">
                            <svg class="icon">
                                <use xlink:href="#icon-angellist"></use>
                            </svg>
                        </span>
                    </a>

                    <a href="https://keybase.io/f3d0r" class="profile-card-social__item behance" target="_blank">
                        <span class="icon-font">
                            <svg class="icon">
                                <use xlink:href="#icon-keybase"></use>
                            </svg>
                        </span>
                    </a>

                    <a href="https://blog.fedor.me" class="profile-card-social__item codepen" target="_blank">
                        <span class="icon-font">
                            <svg class="icon">
                                <use xlink:href="#icon-blog"></use>
                            </svg>
                        </span>
                    </a>

                    <a href="https://f3d0r.com" class="profile-card-social__item link" target="_blank">
                        <span class="icon-font">
                            <svg class="icon">
                                <use xlink:href="#icon-portfolio"></use>
                            </svg>
                        </span>
                    </a>

                </div>

                <div class="profile-card-ctr">
                    <button class="profile-card__button button--blue js-message-btn">Message</button>
                    <button class="profile-card__button button--orange">
                        <a href="mailto:me@f3d0r.com">Email</a>
                    </button>
                </div>
            </div>

            <div class="profile-card-message js-message">
                <form name="Contact" class="profile-card-form" method="POST" netlify>
                    <div class="profile-card-form__container">
                        <textarea class="message_text" name="message" placeholder="Say something..."></textarea>
                    </div>

                    <div class="profile-card-form__bottom" action>
                        <button id="send_button" class="profile-card__button button--blue js-message-close">
                            Send
                        </button>

                        <button id="cancel_button" class="profile-card__button button--gray js-message-close">
                            Cancel
                        </button>
                    </div>
                </form>

                <div class="profile-card__overlay js-message-close"></div>
            </div>

        </div>

    </div>
